"use strict";

const STYLES = {
    fixHeader: {
        css: `
            .main-menu > * {
                position: relative !important;
                top: 0 !important;
            }

            .main-menu > :nth-child(2) {
                display: none;
            }

            .mobile-footer-ufi {
                position: relative !important;
                transform: none !important;
                border-bottom: var(--border-default-themed);
            }`,
    },
    zenMode: {
        css: `
            [data-testid="noncontributor-cta-button"],
            .post-header .post-ufi,
            .post-footer .post-ufi,
            .mobile-footer-ufi,
            .available-content ~ *:not([data-testid="paywall"]),
            .single-post-section,
            .subscribe-footer,
            .publication-footer {
                display: none;
            }

            .post-header > div > :first-child,
            .available-content {
                border-bottom: var(--border-default);
            }
        `,
    },
    removeComments: {
        css: `
            #discussion {
                display: none;
            }
        `,
    },
    showHearts: {
        css: `
            .comment-heart {
                display: none;
            }
        `,
    },
    showFullDate: {
        css: `
            .comment-content .worse-date {
                display: none;
            }

            .comment-content .better-date {
                display: block;
            }

            .comment-content .worse-edited-date {
                display: none;
            }

            .comment-content .better-edited-date {
                display: block;
            }

            .better-edited-date div {
                display: inline;
            }`,
    },
    use24Hour: {
        css: `
            .comment-header .hour24-time {
                display: inline;
            }

            .comment-header .hour12-time {
                display: none;
            }`,
    },
    addParentLinks: {
        css: `
            .parent-link {
                display: none;
            }`,
    },
    applyCommentStyling: {
        css: `
            .comment-body span.new-style {
                display: inline;
            }

            .comment-body span.old-style {
                display: none;
            }`,
    },
    smoothScroll: {
        css: `
            html {
                scroll-behavior: smooth;
            }
        `,
    },
    useOldStyling: {
        css: `
            /* Global vars for responsive sizing */

            :root {
                --web_bg_color: #ffffff !important;

                --entry-padding: 20px;
                --entry-padding-top: 40px;
                --sidebar-margin: 230px;
                --main-radius: 6px;
                --main-shadow: 0 0px 8px 1px rgba(0, 0, 0, 0.75);
                --header-height: 152px;
                --header-gap: 30px;
                --header-icon-size: 60px;
                --title-font-size: 64px;

            }

            @media screen and (max-width: 1200px) {
                :root {
                    --sidebar-margin: 40px;
                }
            }

            @media screen and (max-width: 800px) {
                :root {
                    --entry-padding: 0;
                    --entry-padding-top: 0;
                    --main-radius: 0;
                    --main-shadow: none;
                    --header-height: 112px;
                    --header-gap: 20px;
                    --header-icon-size: 40px;
                    --title-font-size: 32px;
                }
            }

            @font-face {
                font-family: "Raleway";
                src: url(${chrome.runtime.getURL("font/Raleway.ttf")}) format("opentype");
            }



            /* General look */

            html {
                background: url(data:image/png;base64,) !important;
                background-color: #888 !important;
                scrollbar-color: unset !important;
                cursor: auto;
            }

            html body {
                cursor: auto;
            }

            #entry {
                display: flex;
                flex-direction: column;
                align-items: center;
                padding: var(--entry-padding);
                padding-top: var(--entry-padding-top);
            }

            #entry .container {
                margin: 0;
                box-sizing: border-box;
                width: 100%;
            }

            #main {
                overflow: hidden;
                width: 100%;
                max-width: min(1242px, 100%);
                min-height: 0;
                box-shadow: var(--main-shadow);
                border-radius: var(--main-radius);
                background: none;
                -webkit-font-smoothing: auto;
            }

            #main > div:nth-child(2):not(.home-page) {
                display: block;
                padding: 0 var(--sidebar-margin);
                background-color: #e4e4e4;
            }



            /* Main page */

            .home-page > div:first-of-type > div {
                padding: 0;
            }

            .overflow-list-container {
                background: #fff;
            }



            /* Comments page */

            #main > div > .comments-page {
                padding: 10px;
                background: #f0f0f0;
            }

            #main > div > .comments-page > .container > a {
                margin-top: 0;
                margin-right: auto;
                margin-left: 0;
                font: 16px Georgia, "Bitstream Charter", serif;
            }

            #main > div > .comments-page > .container > a:focus-visible {
                border-radius: 4px;
                outline: 2px solid #0053b3;
                outline-offset: 1px;
            }



            /* Buttons and dialogs */

            .post-ufi .post-ufi-button.style-button:hover {
                background-color: #e0e0e0;
            }

            #dialog6 > div > div > div,
            #dialog12 > div > div > div,
            #dialog14 > div > div > div,
            #dialog16 > div > div > div,
            #dialog18 > div > div > div,
            #dialog20 > div > div > div,
            #dialog22 > div > div > div,
            #dialog24 > div > div > div {
                background-color: #e0e0e0;
            }

            article.post > :nth-child(4) > :first-child button:hover {
                background: #bbb8;
            }

            article.post > :nth-child(4) > :first-child button > div > div {
                background: #e2e2e2;
            }

            article.post > :nth-child(4) > :first-child button > div > div.active-Yh0Zwm {
                background: #555;
            }



            /* Topbar */

            .main-menu > * {
                position: relative !important;
                top: 0 !important;
            }

            .main-menu > :first-child > :first-child {
                align-items: center;
                gap: var(--header-gap);
                transition: unset;
                border: none;
                box-sizing: border-box;
                height: var(--header-height) !important;
                padding: 12px;
                background: linear-gradient(to bottom, #8babe8 0%, #4f73c1 100%);
                text-decoration: none;
            }

            .main-menu > :first-child > :first-child > :first-child {
                display: flex;
                flex: 1 calc(var(--header-icon-size) + var(--header-gap)) !important;
                justify-content: end;
                transform: translateY(6px);
            }

            .main-menu > :first-child > :first-child > :first-child img,
            .main-menu > :first-child > :first-child > :first-child > a > div > div {
                width: var(--header-icon-size) !important;
                height: var(--header-icon-size) !important;
            }

            .main-menu > :first-child > :first-child > :nth-child(2) {
                transform: translateY(6px);
                white-space: normal;
                color: white;
            }

            .main-menu > :first-child > :first-child > :nth-child(3) {
                align-self: start;
                min-width: 0;
            }

            .main-menu h1 {
                font-size: var(--title-font-size);
                line-height: unset;
                font-family: 'Raleway', Open Sans, Arial, sans-serif;
                font-weight: normal;
                text-align: center;
                letter-spacing: 2px;
                -webkit-font-smoothing: auto;
            }

            .main-menu h1 a {
                color: white;
            }

            .main-menu > :not(:first-child) {
                display: none;
            }

            #trigger5 div,
            #dialog6 div {
                outline: none;
            }



            /* Title and post info */

            .post-title {
                margin-bottom: 10px;
                font: 16px/1.3em Georgia, "Bitstream Charter", serif;
                font-weight: normal;
                text-transform: uppercase;
                letter-spacing: 1px;
                -webkit-font-smoothing: auto;
            }

            .subtitle {
                padding-bottom: 8px;
                font: 12px/20px Verdana, sans-serif;
            }

            .subtitle + div > :first-child > div > div > div > div {
                display: inline;
                margin-right: 16px;
                border: 1px solid #eee;
                padding: 5px 7px;
                background: #f9f9f9;
                font: 10px Verdana, sans-serif;
                text-transform: uppercase;
                letter-spacing: 1px;
                text-shadow: 1px 1px 1px #fff;
                color: #888;
            }

            .post-header > div > :first-child > div > div > div > div:before {
                content: "Posted on ";
            }

            .post-header > div > :first-child > div > div > div > div:after {
                content: " by Scott Alexander";
            }

            .post-header > div > :first-child > div > div > div > :nth-child(2) {
                display: none;
            }



            /* Post content */

            .single-post-container,
            #main > div > .comments-page {
                padding: 10px;
                border-left: 1px solid #ddd;
                border-right: 1px solid #ddd;
                background: #f0f0f0;
            }

            .single-post {
                margin-bottom: 10px;
                border: 1px solid #d5d5d5;
                border-radius: 10px;
                padding: 20px 28px;
                background: #fff;
            }

            article {
                padding: 0;
            }

            #main .post-header > div > :first-child,
            article .available-content {
                border-bottom: none;
            }

            article h2 {
                font: bold 18px Verdana, sans-serif;
                color: #333;
                -webkit-font-smoothing: auto;
            }

            article button[aria-label="Link"] {
                background-color: #c8c8c8;
            }

            article button[aria-label="Link"]:hover {
                background-color: #bbb;
            }

            article .available-content p,
            article .available-content li {
                font: 12px/20px Verdana, sans-serif;
                color: #333;
            }

            figcaption,
            .footnote-content {
                font: 12px/20px Verdana, sans-serif;
                -webkit-font-smoothing: auto;
            }

            div:has(> .footnote-hovercard) {
                border-color: #d5d5d5;
            }

            .footnote-hovercard {
                padding: 4px 8px;
            }

            article .footnote-anchor {
                margin-left: 2px;
                font-size: 11px;
            }

            article .footnote-number {
                font: 13px Verdana, sans-serif;
            }

            article .available-content p a {
                text-decoration: underline;
                color: #0066cc;
            }

            article .available-content blockquote,
            .comment-list-container .comment blockquote {
                margin: 0 2em;
                border-left: 4px solid #ddd;
                padding: 0 1em;
            }

            article .available-content blockquote p,
            .comment-list-container blockquote {
                margin-left: 0;
                line-height: 24px;
                font-size: 13px;
                font-family: Georgia, "Bitstream Charter", serif;
                font-style: italic;
            }

            article .available-content pre {
                background-color: #e4e4e4;
                margin: 24px 0;
                padding: 10px 16px;
            }

            article .available-content pre code {
                font: 13px/16px monospace;
            }

            .typography .markup .tweet {
                background-color: #fff;
            }



            /* Comments container */

            #discussion {
                gap: 0;
                padding-bottom: 0;
            }

            #discussion > :first-child > h4,
            #main > div > .comments-page > .container > :first-child > div {
                margin-top: 0;
                font: 16px Georgia, "Bitstream Charter", serif;
                font-weight: normal;
                letter-spacing: 1px;
                text-transform: uppercase;
                -webkit-font-smoothing: auto;
            }

            #discussion > :first-child > h4 {
                margin-bottom: 12px;
            }

            .return-to-thread-link {
                font-family: Verdana, sans-serif;
            }

            #entry #comment-toggle-container {
                margin-bottom: 12px;
            }

            #comment-toggle-container .comment-toggle {
                font: 14px Verdana, sans-serif;
            }

            #comment-toggle-container .segmented-control {
                border-color: #ddd;
                background-color: #e8e8e8;
            }

            #comment-toggle-container .segmented-control button[data-selected="true"] {
                background-color: #fff;
            }

            #comment-toggle-container button {
                font: 12px Verdana, sans-serif;
            }

            .comments-page > .container {
                box-sizing: border-box;
                border: 1px solid #d5d5d5;
                border-radius: 10px;
                padding: 17px;
                background-color: white;
                justify-content: center;
            }



            /* Comment box form */

            [data-test-id="comment-input"] form {
                margin-bottom: 16px;
            }

            [data-test-id="comment-input"] form div {
                font-size: 14px !important;
            }

            [data-test-id="comment-input"] form > div:first-child,
            [data-test-id="comment-input"] form > div:first-child div,
            [data-test-id="comment-input"] form img {
                border-radius: 0px;
                outline: none;
                height: 41px;
                width: 41px;
            }

            [data-test-id="comment-input"] button[type="submit"]:disabled {
                background-color: #ddd;
                color: transparent;
            }

            [data-test-id="comment-input"] textarea:focus-visible {
                overflow: unset;
                box-shadow: none;
            }



            /* Comment element */

            #discussion .comment-list-items .comment,
            .comments-page .comment-list-items .comment {
                margin-top: 0;
            }

            .comment-list-items .comment .children {
                padding-left: calc(41px + 12px);
            }

            .comment .comment-content {
                padding-bottom: 12px;
            }

            .comment-content .comment-main {
                flex-grow: 1;
                box-sizing: border-box;
                border: 1px solid #ddd;
                border-radius: 10px;
                padding: 4px 10px;
                background: #fafafa;
            }

            .comment.selected > .comment-content::before {
                content: unset;
            }

            .comment.selected > .comment-content .comment-main {
                background: #de912d2c;
            }

            .comment-content .comment-header {
                flex-grow: 0;
                border: none;
                background: none;
            }

            div.profile-icon {
                width: 41px;
                height: 41px;
            }

            .profile-picture .profile-image {
                position: relative;
                border-radius: 0px;
                outline: none;
                width: 41px;
                height: 41px;
                font: 12px Verdana, sans-serif;
            }

            .comment .collapser {
                top: 41px;
                margin-top: 8px;
                width: 41px;
                height: calc(100% - 41px - 12px - 8px);
            }

            .comment .collapser .outline {
                width: 100%;
                padding: 0;
            }

            .comment .collapser .line {
                background-color: #ccc;
            }

            .comment .collapser:hover .line {
                box-shadow: inset 1px 0 #aaa;
            }



            /* Comment meta */

            .comment-main .comment-header {
                display: initial;
            }

            .comment-main .comment-header a {
                display: inline-block;
            }

            .comment-main .comment-header div {
                font-size: 12px;
            }

            .comment-main .comment-header .username {
                display: block;
                margin-bottom: 2px;
                line-height: 24px;
                font-family: Verdana, sans-serif;
                font-weight: bold;
                text-decoration: none;
                color: black;
            }

            .comment-main .comment-header .user-profile-link .username:after {
                content: " says:";
                font-weight: normal;
                font-style: italic;
                color: #333;
            }

            .comment-main .comment-header .comment-post-date,
            .comment-main .comment-header .comment-edited {
                font-family: Georgia, "Bitstream Charter", serif;
                text-decoration: none;
                color: #888;
            }

            .deleted > .comment-content .comment-header .username {
                font-size: 12px;
            }

            .reason-line {
                font: 12px/24px Verdana, sans-serif;
            }



            /* Comment content */

            .comment .comment-content .comment-body {
                overflow-y: visible;
                margin-top: 10px;
            }

            .comment-content .comment-body p {
                font: 12px/24px Verdana, sans-serif;
                color: #333;
            }

            .comment-content .comment-body a {
                color: #0066cc;
                text-decoration: underline;
            }

            .comment-content .comment-body a:hover {
                color: #ff4b33;
            }

            .comment-content .comment-body i {
                font: italic 12px/24px Verdana, sans-serif;
            }



            /* Comment actions */

            .comment-main .comment-footer {
                gap: 12px;
            }

            .comment-main .comment-footer > button {
                margin-top: 4px;
                margin-bottom: 7px;
                font-size: 12px;
                line-height: normal;
                font-family: Georgia, "Bitstream Charter", serif;
                text-transform: capitalize;
                text-decoration: underline;
                text-decoration-thickness: 1px;
                color: #888 !important;
            }

            .comment-main .comment-footer > button.meatball {
                text-decoration: none;
            }

            .comment.collapsed > .comment-content .comment-main .comment-footer {
                transform: none;
            }

            .text-input-container {
                margin-bottom: 4px;
            }

            .text-input-container textarea {
                font: 12px/20px Verdana, sans-serif;
                color: #333;
            }

            [data-test-id="comment-input"] button,
            .text-input-container .text-input-buttons button {
                border-radius: 4px;
                height: 32px;
                padding: 7px 20px;
                font: unset;
                font-size: 14px;
            }

            [data-test-id="comment-input"] button[type="submit"],
            .text-input-container .text-input-buttons button.primary {
                background-color: #0675c4;
            }

            [data-test-id="comment-input"] button[type="submit"]:hover,
            .text-input-container .text-input-buttons button.primary:hover {
                background-color: #055d9c;
            }

            .text-input-container .text-input-buttons button.primary:disabled {
                border-color: #dcdcde;
                background-color: #ddd;
                color: #a7aaad;
            }

            [data-test-id="comment-input"] button[type="button"],
            .text-input-container .text-input-buttons button.secondary {
                background-color: #ddd;
            }

            [data-test-id="comment-input"] button[type="button"]:hover,
            .text-input-container .text-input-buttons button.secondary:hover {
                background-color: #ccc;
            }

            .footer-menu {
                background-color: white;
            }

            .footer-menu-content button:hover {
                background-color: #d8d8d8;
            }



            /* New comments */

            .highlight-new .comment.new-comment > .comment-content .comment-main {
                outline: 2px solid #5a5;
                outline-offset: -1px;
            }

            .highlight-new .comment .comment-header .new-tag-text {
                display: none;
            }



            /* Other cleanup */

            .recommendations-page-container {
                margin-top: 0;
                margin-bottom: 0;
                padding: 20px 0;
            }

            .publication-footer {
                position: relative;
            }

            .publication-footer .footer {
                border: none;
                background: #e4e4e4;
            }`,
    },
}
